ModuleRegistry.registerModules([MenuModule, ServerSideRowModelModule, SetFilterModule]);




const countryCodeKeyCreator: (params: KeyCreatorParams) =>  string  = (params: KeyCreatorParams) =>{
    return params.value.code;
}

const countryValueFormatter: (params: ValueFormatterParams) =>  string  = (params: ValueFormatterParams) =>{
    return params.value.name;
}

const countryComparator: (a: {
    name: string;
    code: string;
}, b: {
    name: string;
    code: string;
}) =>  number  = (a: {
    name: string;
    code: string;
}, b: {
    name: string;
    code: string;
}) =>{
    // for complex objects, need to provide a comparator to choose what to sort by
    if (a.name < b.name) {
        return -1;
    }
    else if (a.name > b.name) {
        return 1;
    }
    return 0;
}

var fakeServer: any;

var selectedCountries: string[] | null = null;

function areEqual(a: null | string[], b: null | string[]) {
    if (a == null && b == null) {
        return true;
    }
    if (a != null || b != null) {
        return false;
    }
    return (a!.length === b!.length &&
        a!.every(function (v, i) {
            return b![i] === v;
        }));
}

function getCountryValuesAsync(params: SetFilterValuesFuncParams) {
    var countries = fakeServer.getCountries();
    // simulating real server call with a 500ms delay
    setTimeout(() => {
        params.success(countries);
    }, 500);
}

function getSportValuesAsync(params: SetFilterValuesFuncParams) {
    var sports = fakeServer.getSports(selectedCountries);
    // simulating real server call with a 500ms delay
    setTimeout(() => {
        params.success(sports);
    }, 500);
}

const getServerSideDatasource: (server: any) =>  IServerSideDatasource  = (server: any) =>{
    return {
        getRows: (params) => {
            console.log('[Datasource] - rows requested by grid: ', params.request);
            // get data for request from our fake server
            var response = server.getData(params.request);
            // simulating real server call with a 500ms delay
            setTimeout(() => {
                if (response.success) {
                    // supply rows for requested block to grid
                    params.success({ rowData: response.rows, rowCount: response.lastRow });
                }
                else {
                    params.fail();
                }
            }, 500);
        },
    };
}



