            <AgGridReact<IOlympicData>
                ref={gridRef}

columnDefs={columnDefs}
defaultColDef={defaultColDef}
rowModelType={'serverSide'}
cacheBlockSize={100}
maxBlocksInCache={10}
onGridReady={onGridReady}
onFilterChanged={onFilterChanged}
            />
        </div>

            </div>
        );

}

